import React, {useContext} from 'react'
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import AuthContext from '../Context/AuthContext';
import { useNavigate,Link } from 'react-router-dom';
import "./Login.css";

function Header() {
  let {userLogout} = useContext(AuthContext)
  return (
    <div style={{'background-color': 'silver'}}>

<Navbar bg="light" expand="lg">
      <Container fluid>
        <Navbar.Brand href="#">Welcome</Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            navbarScroll
          >
            <Button type='submit' className='logout_button, login' variant="outline-dar" onClick={userLogout}>Logout</Button>
            <Link to='/admin' className='m-3' style={{'textDecoration': 'None', 'color':'blue',}}> <h3>Home</h3> </Link> <br></br>
            <Link to='/pending' className='m-3' style={{'textDecoration': 'None', 'color':'blue',}}> <h3>Pending</h3></Link> <br></br>
            <Link to='/Approved' className='m-3' style={{'textDecoration': 'None', 'color':'blue',}}> <h3>Approved</h3></Link> <br></br>
            <Link to='/Rejected' className='m-3' style={{'textDecoration': 'None', 'color':'blue',}}> <h3>Rejected</h3></Link> <br></br>
            <Link to='/Users' className='m-3' style={{'textDecoration': 'None', 'color':'blue',}}> <h3>Users</h3></Link> <br></br>
            <Link to='/slotbooking' className='m-3' style={{'textDecoration': 'None', 'color':'blue',}}> <h3>SlotBooking</h3></Link><br></br>

              
            
          </Nav>
          <Form className="d-flex">
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
            />
            <Button variant="outline-success">Search</Button>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
    </div>
  )
}

export default Header
